import React, { useEffect, useState } from 'react';
import api from '../api/axiosInstance';  // Use your axios instance with auth interceptors
import '../css/Login.css';

function StaffBooking() {
  const [bookings, setBookings] = useState([]);
  const [filter, setFilter] = useState('');
  const [filteredBookings, setFilteredBookings] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchBookings();
  }, []);

  const fetchBookings = async () => {
    try {
      const response = await api.get('/bookings/');
      setBookings(response.data);
      setFilteredBookings(response.data);
    } catch (err) {
      console.error('Failed to fetch bookings:', err);
      setError('Failed to fetch bookings');
    }
  };

  const handleFilterChange = (e) => {
    const keyword = e.target.value.toLowerCase();
    setFilter(keyword);

    if (keyword.trim() === '') {
      setFilteredBookings(bookings);
    } else {
      const filtered = bookings.filter(booking =>
        (booking.student_name && booking.student_name.toLowerCase().includes(keyword)) ||
        (booking.tour_title && booking.tour_title.toLowerCase().includes(keyword)) ||
        (booking.parent_name && booking.parent_name.toLowerCase().includes(keyword))
      );
      setFilteredBookings(filtered);
    }
  };

  return (
    <div className="dashboard-content" style={{ padding: '20px', minHeight: '100vh' }}>
      <h2>Staff - View Bookings</h2>

      {error && <p style={{ color: 'red' }}>{error}</p>}

      <input
        type="text"
        placeholder="Filter by student, tour or parent..."
        value={filter}
        onChange={handleFilterChange}
        style={{
          padding: '8px',
          marginBottom: '20px',
          width: '100%',
          maxWidth: '400px',
          borderRadius: '4px',
          border: '1px solid #ccc',
        }}
      />

      {filteredBookings.length === 0 ? (
        <p>No bookings found.</p>
      ) : (
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr style={{ backgroundColor: '#f2f2f2' }}>
              <th style={thStyle}>Booking ID</th>
              <th style={thStyle}>Parent</th>
              <th style={thStyle}>Student</th>
              <th style={thStyle}>Tour</th>
              <th style={thStyle}>Booking Date</th>
              <th style={thStyle}>Status</th>
              <th style={thStyle}>Amount</th>
            </tr>
          </thead>
          <tbody>
            {filteredBookings.map(booking => (
              <tr key={booking.booking_id} style={{ borderBottom: '1px solid #ddd' }}>
                <td style={tdStyle}>{booking.booking_id}</td>
                <td style={tdStyle}>{booking.parent_name || 'N/A'}</td>
                <td style={tdStyle}>{booking.student_name || 'N/A'}</td>
                <td style={tdStyle}>{booking.tour_title || 'N/A'}</td>
                <td style={tdStyle}>{new Date(booking.booking_date).toLocaleDateString()}</td>
                <td style={tdStyle} style={{ textTransform: 'capitalize' }}>{booking.status}</td>
                <td style={tdStyle}>{booking.amount}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

const thStyle = {
  padding: '10px',
  border: '1px solid #ddd',
  textAlign: 'left',
};

const tdStyle = {
  padding: '10px',
  border: '1px solid #ddd',
};

export default StaffBooking;
